import React from "react";
import Tilt from "react-tilt";
import { LogoContainer } from "./logo.styles";
const Logo = () => {
  return (
    <>
      <LogoContainer>
        <Tilt
          className="Tilt"
          options={{ max: 25 }}
          style={{ height: 250, width: 250 }}
        >
          <div className="Tilt-inner"></div>
        </Tilt>
      </LogoContainer>
    </>
  );
};
export default Logo;
